import React from "react";

export const Services = () => {
  return (
    <div className="services">
      <div className="services_conatiner mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="services_sub text-center">Features</div>
        <div className="services_title">What I Do</div>
        <div className="services_content">
          <div className="services_content_item1">UI/UX Designer</div>
          <div className="services_content_item2">Front-end Developer</div>
          <div className="services_content_item3">Graphic Designer</div>
          <div className="services_content_item4">Website Developer</div>
          <div className="services_content_item5"></div>
          <div className="services_content_item6"></div>
        </div>
      </div>
    </div>
  );
};
